import React, { useEffect, useState } from'react';
import axios from 'axios';

const useFetch = (url) => {
  const [posts, setPosts] = useState(null);

  useEffect(async () => {
    const response = await fetch(url)
    const [data] = await response.json();
    const [query] = data.results;
    setPosts(query);
  }, []);
  return posts;
}

